	create_by varchar(64) NULL COMMENT '创建人',
	create_time DATETIME NULL COMMENT '创建时间',
	update_by varchar(64) NULL COMMENT '更新人',
	update_time DATETIME NULL COMMENT '更新时间',
	CONSTRAINT we_sensitive_pk PRIMARY KEY (id)
